angular.module("YouTube Feed").service("getPlaylists",function(e,r,n){return{playlistQuery:function(t,u){var s=r.defer();return e({url:t,method:"GET",params:{part:"snippet",channelId:u,key:n,maxResults:50}}).success(function(e){return s.resolve(e),s}).error(function(e){console.log(e),s.reject()}),s.promise}}});